goldenRatio = (1 + 5 ** 0.5) / 2  # 1.61803398875

# lact1

b11 = 0.0682630516899
b12 = 1.75566307492
b21 = 0.0342523205177
b22 = 11.4277455997


class errorCalculator:
    def calculateError(self, lDate, lData, gR, dR, k, der=0):



        lacEstimate = [None] * len(lDate)
        absSum=0
        errDiff=np.zeros(len(lData))
        for i in range(0, len(lData)):
            lactDateNorm = (lDate[i] / 900)
            G_pdf_beta = stats.beta.pdf(lactDateNorm, b11,  b12)
            D_pdf_beta = stats.beta.pdf(lactDateNorm,  b21, b22)
            Exp1 = math.exp(G_pdf_beta * gR * lDate[i])
            Exp2 = math.exp(D_pdf_beta * dR* lDate[i])

            if(der==0):
                #org f
                lacEstimate[i] = k * (1 + (Exp1 - Exp2))
            if(der==1):
                #der k
                lacEstimate[i] = (1 + (Exp1 - Exp2))
            if(der==2):
                #der gr
                lacEstimate[i] = k * ((Exp1 * G_pdf_beta * lDate[i]))
            if(der==3):
                #der dr
                lacEstimate[i] = -k * Exp2 * D_pdf_beta * lDate[i]
            if(der==4):
                #der gr2
                lacEstimate[i] = k * ((Exp1 * G_pdf_beta * lDate[i]) - (Exp2 * D_pdf_beta * (1 / goldenRatio) * lDate[i]))
            if(der==5):
                #der b1a
                lacEstimate[i]= k * lDate[i] * gR * self.derBa(lactDateNorm, b11, b12) * Exp1
            if(der==6):
                # der b1b
                lacEstimate[i] = k * lDate[i] * gR * self.derBb(lactDateNorm, b11, b12) * Exp1
            if (der == 7):
                # der b2a
                lacEstimate[i] = -k * lDate[i] * dR * self.derBa(lactDateNorm, b21, b22) * Exp2
            if (der == 8):
                # der b2b
                lacEstimate[i] = -k * lDate[i] * dR * self.derBb(lactDateNorm, b21, b22) * Exp2



            ld=lData[i]
            diff=0
            if(ld!=0):
                diff=math.fabs(ld-lacEstimate[i])/ld

            absSum=absSum+diff



        return lacEstimate, absSum/len(lData), 100 * ((sum(lData) - sum(lacEstimate)) / sum(lData))

    def derBa(slef,x, a, b):

        return (pow(x, a - 1) * pow(1 - x, b - 1) * (
        special.digamma(a + b) - special.digamma(a) + math.log(x, math.e))) / stats.beta.stats(a, b)[0]

    def derBb(self,x, a, b):
        return (pow(x, a - 1) * pow(1 - x, b - 1) * (
        special.digamma(a + b) - special.digamma(b) + math.log(x, math.e))) / stats.beta.stats(a, b)[0]


class GradientUpdate:
    def __init__(self, lDate, lData, upperLimit=-1, lowerLimit=0, betaSearch=False):
        if (upperLimit != -1):
            self._upperLimit = upperLimit
        else:self._upperLimit=len(lData)
        if(lowerLimit!=0):
            self._lowerLimit=lowerLimit
        self._lData=lData[lowerLimit:upperLimit]
        self._lDate=lDate[lowerLimit:upperLimit]

        self._lastObj=999999999
        self._fullDate=lDate
        self._fullData = lData
        self._betaSearch=betaSearch;


    def  perform(self):

        runn=0.1
        gr=2.63/100
        #gr=0.0480638508279
        dr = gr / 1.61803398875
        #dr = 0.0297050934419
        k=2.77156574484846
        plt.show()
        etha1=0.000001
        global b11
        global b12
        global b21
        global b22
        etha2 = 0.000000001
        etha3 = 0.000000001
        etha4 = 0.000000000001
        etha5 = 0.0000000003

        plt.title("Trial")
        costCount=errorCalculator()
        weightOfLastPortion = 1
        weightOfFirstPottion = 1
        lasrPerPercentage=0.00
        extraWeightOfLastPortion=1

        while runn/20<=1:
            tempCost=costCount.calculateError(self._lDate, self._lData, gr, dr, k)
            Error=sum([math.sqrt(math.pow((y_i-b_i),2))/2 for y_i, b_i in zip(self._lData, tempCost[0])])
            if(lasrPerPercentage!=0):
                weightOfLastPotion=weightOfLastPortion*(1-lasrPerPercentage)/(lasrPerPercentage)

            indextOfPortionBorder = int(len(tempCost[0]) * (1-lasrPerPercentage))-1
            lowerLimit = int(len(tempCost[0]) * (1-lasrPerPercentage))
            upplerLimit = len(tempCost[0])

            FtYt=[y_i - b_i for y_i, b_i in zip(self._lData, tempCost[0])]

            derVa=costCount.calculateError(self._lDate, self._lData, gr, dr, k,1)
            print(derVa[0])
            t = [x *weightOfFirstPottion for x in derVa[0][1:indextOfPortionBorder]]+ [x *weightOfLastPotion*extraWeightOfLastPortion for x in derVa[0][upplerLimit:lowerLimit]]
            dA=-1*sum([y_i*b_i for y_i, b_i in zip(FtYt, t)])
            derGr = costCount.calculateError(self._lDate, self._lData, gr, dr, k,4)
            t = [x *weightOfFirstPottion for x in derGr[0][1:indextOfPortionBorder]]+[x *weightOfLastPotion*extraWeightOfLastPortion for x in derGr[0][lowerLimit:upplerLimit]]
            dgR =  -1*sum([y_i * b_i for y_i, b_i in zip(FtYt, t)])
            derGr2 = costCount.calculateError(self._lDate, self._lData, gr, dr, k,2)
            t = [x * weightOfFirstPottion for x in derGr2[0][1:indextOfPortionBorder]] + [x * weightOfLastPotion * extraWeightOfLastPortion for x in derGr2[0][lowerLimit:upplerLimit]]
            dgR2 = -1 * sum([y_i * b_i for y_i, b_i in zip(FtYt, t)])
            derDr = costCount.calculateError(self._lDate, self._lData, gr, dr,k,3)
            t = [x *weightOfFirstPottion for x in derDr[0][1:indextOfPortionBorder]]+ [x *weightOfLastPotion*extraWeightOfLastPortion for x in derDr[0][lowerLimit:upplerLimit]]
            dgD = -1*sum([y_i * b_i for y_i, b_i in zip(FtYt, t)])

            derB1a = costCount.calculateError(self._lDate, self._lData, gr, dr,k,5)
            t = [x * weightOfFirstPottion for x in derB1a[0][1:indextOfPortionBorder]] + [x * weightOfLastPotion * extraWeightOfLastPortion for x in derB1a[0][lowerLimit:upplerLimit]]
            dgB1a = -1 * sum([y_i * b_i for y_i, b_i in zip(FtYt, t)])

            derB1b = costCount.calculateError(self._lDate, self._lData, gr, dr,k,6)
            t = [x * weightOfFirstPottion for x in derB1b[0][1:indextOfPortionBorder]] + [x * weightOfLastPotion * extraWeightOfLastPortion for x in derB1b[0][lowerLimit:upplerLimit]]
            dgB1b = 1 * sum([y_i * b_i for y_i, b_i in zip(FtYt, t)])

            derB2a = costCount.calculateError(self._lDate, self._lData, gr, dr,k,7)
            t = [x * weightOfFirstPottion for x in derB2a[0][1:indextOfPortionBorder]] + [x * weightOfLastPotion * extraWeightOfLastPortion for x in derB2a[0][lowerLimit:upplerLimit]]
            dgB2a = -1 * sum([y_i * b_i for y_i, b_i in zip(FtYt, t)])

            derB2b = costCount.calculateError(self._lDate, self._lData, gr, dr,k,8)
            t = [x * weightOfFirstPottion for x in derB2b[0][1:indextOfPortionBorder]] + [x * weightOfLastPotion * extraWeightOfLastPortion for x in derB2b[0][lowerLimit:upplerLimit]]
            dgB2b = 1 * sum([y_i * b_i for y_i, b_i in zip(FtYt, t)])

            k = k - etha1 * np.sign([dA])[0]

            if (runn / 20 > 0.49 and self._betaSearch==False):
                etha2 = 0.0000000001
                etha3 = 0.000000001
                dr = dr - etha3 * dgD
                gr = gr - etha2 * dgR2

            else:
                gr = gr - etha2 * dgR
                dr = gr /goldenRatio


            if(k<1):
                 k=1
            if (gr < 0):
                 gr =0
            if (gr > 1):
                 gr = 1
            if (dr <0):
                 dr =0
            if (dr > 1):
                 dr = 1

            if(self._betaSearch):
                b11 = b11 - etha4 * dgB1a
                b12 = b12 - etha5 * dgB1b
                b21 = b21 + etha4 * dgB2a
                b22 = b22 - etha5 * dgB2b

                # if (b11) < 0.0001:
                #     b11 = 0.0001
                # if (b12) < 0.0001:
                #     b12 = 0.0001
                # if (b21) < 0.0001:
                #     b21 = 0.0001
                # if (b22) < 0.0001:
                #     b11 = 0.0001
                #
                # if (b11) > 1:
                #     b11 = 1
                # if (b12) > 10.0001:
                #     b12 = 10.0001
                # if (b21) > 1:
                #     b21 = 1
                # if (b22) < 10.0001:
                #     b22 = 10.0001
                print("B parms", b11, b12, b21, b22, "k= ", k, "error= ", Error)

            runn=runn+0.1

            trial= costCount.calculateError(self._fullDate, self._fullData, gr, dr, k)
            plt.clf()
            plt.title((runn/20)*100)
            plt.plot(self._fullDate, self._fullData)
            plt.plot(self._fullDate, trial[0])
            plt.plot(self._lDate, self._lData)
            plt.plot(self._lDate, tempCost[0])
            plt.pause(0.01)

        return k,gr, dr


