def transformSVM(date, dat, upper, lower):
    dta = dat[lower:upper]
    dte = date[lower:upper]

    dta2 = date[lower:upper]
    X = np.reshape(dte, (-1, 1))
    y = dta

    svr_rbf = SVR(kernel='rbf', C=30, gamma=0.001)
    svr_rbf.fit(X, y)
    return dta2, svr_rbf.predict(X)


